import React from "react";
import { Switch, Route } from "react-router-dom";
import About from "./About";
import Rating from "./Rating";
function Companyinfo() {
  return (
    <>
      <section className="container padding">
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="#"></Route>
          <Route path="/rating">
            <Rating />
          </Route>
        </Switch>
      </section>
    </>
  );
}

export default Companyinfo;
